index.css:
.speeddial-appearence-target {
    min-height: 310px;
    width: 70%;
    margin: 5% 15%;
    position: relative;
}
.custom-index {
    z-index: 500 !important;
}

@media only screen and (max-width: 600px) {
    .speeddial-appearence-target {
        min-height: 350px;
        width: 90%;
        margin: 5%;
    }
}
/* Represents the styles for icon */
@font-face {
    font-family: 'speeddial-icons';
    src: url(data:application/x-font-ttf;charset=utf-8;base64,) format('truetype');
    font-weight: normal;
    font-style: normal;
}

[class^="speeddial-icon-"],
[class*="speeddial-icon-"] {
    font-family: 'speeddial-icons' !important;
    speak: none;
    font-style: normal;
    font-weight: normal;
    font-variant: normal;
    text-transform: none;
    line-height: inherit;
    -webkit-font-smoothing: antialiased;
    -moz-osx-font-smoothing: grayscale;
}

.speeddial-icon-cut:before {
        content: "\e70a";
}

.speeddial-icon-copy:before {
    content: "\e70b";
}

.speeddial-icon-paste:before {
    content: "\e70c";
}

.speeddial-icon-delete:before {
    content: "\e70d";
}

.speeddial-icon-save:before {
    content: "\e70e";
}

.speeddial-icon-edit:before {
    content: "\e70f";
}

